import React from "react";
import { Link, NavLink } from "react-router-dom";

const ListLink = [
  {
    id: 1,
    to: "/",
    title: "home",
  },
  {
    id: 2,
    to: "/blog",
    title: "blog",
  },
  {
    id: 3,
    to: "/profile",
    title: "profile",
  },
];
const Nav = () => {
  return (
    <div className="p-5 bg-white shadow-md flex items-center justify-center gap-x-5">
      {ListLink.map((link, id)=>(
         <NavLink to={link.to} className={({isActive}) => (isActive)? "text-green-400" : ""}>
            {link}
         </NavLink>
      ))}
    </div>
  );
};

export default Nav;
